class Solution:    def singleNumber(self, nums: List[int]) -> int:        dict = {} # Create an empty dict to be filled                for i in nums:            #function .get will check if key i exists. If it exists it returns            # the value stored under that key. If it doesn't exist it returns 0            # Add 1 to count             dict[i] = dict.get(i,0) + 1                     for key in dict:            # if the dict freq is 1, return that key            if dict[key] == 1:                return key